import React from 'react';
import './projects.css';
import Iframe from 'react-iframe'

export class Projects extends React.Component {
    constructor(props) {
        super(props)
    }

    render() {
        return <div>
        <h2>JavaScript Bookstore Website</h2>    
        <Iframe url="https://diskographi.github.io/Diskographi-github.io/"
        width="90%"
        height="600px"
        id="jsClass"
        className="mangaShop"
        display="initial"
        position="relative"/>
        <h2>Python Twitter Bot</h2>    
        <a class="twitter-timeline" href="https://twitter.com/Diskographi1?ref_src=twsrc%5Etfw">Tweets by Diskographi1</a> <script async src="https://platform.twitter.com/widgets.js" charset="utf-8"></script>
        <p>This twitter account will automatically search for and retweet
            tweets from a certain search topic using the Twitter API.
        </p>
        </div>
    }
}
